///js/library/jQuery/center.js
$.fn.center = function () {
	$(this).css({
		position:   'absolute',
		display:    'block',
		left:       '50%',
		top:        '50%'
	});
	$(this).css({
		marginLeft: '-' + ($(this).outerWidth() / 2) + 'px',
		marginTop: '-' + ($(this).outerHeight() / 2) + 'px'
	});
};
///js/library/jQuery/ajax-link.js
$.fn.ajaxLink = function (params) {

	var defaults = {
		disableLayout: true,
		success: function (response) {
			alert('doing nothing');
		}
	};
	for (p in params) {
		defaults[p] = params[p];
	}
	params = defaults;

	$(this).onlyClick(function () {
		var href = $(this).attr('href');
		if (href == undefined) {
			href = $(this).closest('a').attr('href');
		}

		$.ajax({
			url: href,
			success: function (response) {
				params.success.call(this, response);
				window.application.bootstrap().run();
			}.bind(this),
			type: 'GET',
			data: {
				disableLayout: params.disableLayout
			}
		});
		return false;
	});
};
///js/library/jQuery/getClasses.js
$.fn.getClasses = function () {
	var classname = $(this).attr('class');
	return (classname) ? classname.split(/\s/) : [];
};
///js/library/jQuery/filterClasses.js
$.fn.filterClasses = function (allowedClasses) {
	var classes = $(this).getClasses();
	$(this).removeClass();
	var classname = classes.intersect(allowedClasses).join(' ');
	$(this).addClass(classname);
	return $(this);
}
///js/library/jQuery/overlay.js
$.fn.overlay = function () {
	if (!$(this).data('overlay-object')) {
		$(this).data('overlay-object', new Overlay(this));
		return $(this);
	}
	return $(this).data('overlay-object');
};
///js/library/jQuery/ajax-form.js
$.fn.serializeObject = function (params) {
	var serialized = $(this).serializeArray();
	var params = params || {};
	for (s in serialized) {
		var serializedElement = serialized[s];
		if (serializedElement.name && !(typeof serializedElement.value === 'Object') && !(typeof serializedElement.value == undefined))
			params[serializedElement.name] = serializedElement.value;
	}
	return params;
};

$.fn.ajaxForm = function (params) {

	var defaults = {
		disableLayout: true,
		success: function (response) {
			alert('doing nothing');
		}
	};
	for (p in params) {
		defaults[p] = params[p];
	}
	params = defaults;

	var form = $(this);
	var action = $(this).attr('action');
	if (!action) {
		form = $(this).find('form');
		action = form.attr('action');
	}





	form.submit(function () {

		console.log(form.serializeObject());

		$.ajax({
			url: action,
			success: function (response) {
				params.success.call(this, response);
				window.application.bootstrap().run();
			}.bind(form),
			type: 'POST',
			data: form.serializeObject({
				disableLayout: params.disableLayout
			})
		});
		return false;
	});
};
///js/library/jQuery/shadow.js
$.fn.shadow = function () {
	if ($(this).data('shadow'))
		return $(this);
	var shadow = $('<div></div>')
		.insertBefore($(this));

	var zIndex = parseInt($(this).css('zIndex'));
	$(this).css('zIndex', zIndex + 1);
	shadow.addClass('shadow');
	shadow.css({
		position:   'absolute',
		display:    'block',
		left:       '50%',
		top:        '50%',
		zIndex:     zIndex
	});
	shadow.height($(this).outerHeight());
	shadow.width($(this).outerWidth());
	shadow.css({
		marginLeft: '-' + (shadow.outerWidth() / 2) + 'px',
		marginTop: '-' + (shadow.outerHeight() / 2) + 'px'
	});


	$(this).data('shadow', shadow);
};
